app.use(cors({ origin: '*' }));
app.use(bodyParser.json());

const EXPRESS_SECRET = process.env.EXPRESS_SECRET || 'secret';

// Route
app.post('/api/runBot', async (req, res) => {
  if (req.headers['x-secret'] !== EXPRESS_SECRET) {
    return res.status(403).json({ error: 'Forbidden' });
  }

  // === Browserbase API call ===
  try {
    const bbRes = await axios.post(
      'https://api.browserbase.com/playground/YOUR_SCRIPT_ID/run', // <-- replace with your real script endpoint!
      {
