        input: req.body.input || 'Execute deployment sequence',
      },
      {
        headers: {
          Authorization: 'Bearer YOUR_BROWSERBASE_API_KEY', // <-- insert your Browserbase API key
          'Content-Type': 'application/json',
        },
      }
    );

    res.json({
      output: `Browserbase triggered, session: ${bbRes.data.sessionId || 'n/a'}`,
      browserbase: bbRes.data,
    });
  } catch (err) {
    console.error('Browserbase error:', err.response?.data || err.message);
    res.status(500).json({ error: 'Browserbase API failed', detail: err.response?.data || err.message });
  }
});

app.listen(3000, () => {
  console.log('[+] Express server running on port 3000');
});
```

